import { getJSON } from "../../APIHelpers";

const URI = "http://127.0.0.1:8000";

export const getSimple = async (name, token) => {
    const response = await getJSON(`${URI}/simple/${name}?token=${token}`);
    const json = response.json();
    return json.data;
};
